import React from 'react';
import { redirect } from 'react-router-dom';

export default function TodoFormButton() {
  const handleTodoForm = () => {
    redirect('/create');
  };

  return (
    <div className="create-todo">
      <button
        type="button"
        onClick={() => { handleTodoForm(); }}
        className="btn btn-primary"
      >
        Create a todo.
      </button>
    </div>
  );
}
